(function(){const sidebar=document.querySelector(".sidebar");const logo=document.querySelector(".logo");logo.setAttribute("class","menu-logo");document.querySelector(".main-sidebar").insertBefore(logo,sidebar);$.AdminLTE.options["animationSpeed"]=200;const observer=new MutationObserver((mutations)=>{mutations.forEach((mutation)=>{if(mutation.attributeName!="class")return;if(!mutation.target.classList.contains("active"))return;const ul=mutation.target.querySelector("ul");if(!ul)return;Array.from(ul.querySelectorAll("a")).forEach((element)=>{if(element.href!=location.origin+location.pathname)return;element.parentElement.setAttribute("class","active")})})});switchSkin(localStorage.getItem('skin'));const colorSwitcher=new DOMParser().parseFromString('<li><a href="javascript:void(0);" onclick="switchSkin()" class="container-switch-skin"><i class="fa fa-adjust"></i></a></li>',"text/html").body.childNodes[0];document.querySelector(".user-menu").before(colorSwitcher);document.querySelectorAll(".sidebar-menu>li").forEach((element)=>{observer.observe(element,{attributes:true})})})();function switchSkin(newest){const oldSkin=Array.from(document.body.classList).filter(c=>c.indexOf('skin')>=0&&document.body.classList.remove(c)==undefined);if(oldSkin.length==0)return;const newSkin=newest?newest:nextSkin(oldSkin[0]);document.body.classList.add(newSkin);localStorage.setItem('skin',newSkin)}function nextSkin(oldSkin){const skinList=['skin-black','skin-blue','skin-green','skin-purple','skin-red','skin-yellow','skin-black-light','skin-blue-light','skin-green-light','skin-purple-light','skin-red-light','skin-yellow-light'];const index=skinList.indexOf(oldSkin);return index+1==skinList.length?skinList[0]:skinList[index+1]}